import React from 'react';
import styled from 'styled-components';

const Section = styled.section`
    padding: 20px;
    background-color: #f9f9f9;
    margin-bottom: 20px;
`;

const Banner = styled.img`
    width: 100%;
    height: auto;
    margin-bottom: 20px;
`;

const Home = () => {
    return (
        <div>
            <Section>
                <Banner src="banner1.jpg" alt="Banner 1" />
                <h2>Seção 1</h2>
                <p>Conteúdo da seção 1...</p>
            </Section>
        </div>
    );
};

export default Home;
